--empi

CREATE VIEW [dbo].[v_ccr_empi]
AS
SELECT
    empi,
    max(a.patientid) patientid,
    MAX(a.cardno) AS  cardno,
    eResearch.dbo.DesensitizePatientName(MAX(a.name)) AS  name,
    MAX(a.sex) AS  sex,
    MAX(a.dob) AS  dob,
    MAX(a.NAME) AS TRUENAME ,
    MAX(a.SSN) AS TRUESSN
FROM dw..ccr_patients a WITH (NOLOCK)
join dw..pix b on a.PATIENTID = b.patientid
GROUP BY empi



--PATIENT


CREATE VIEW [dbo].[v_ccr_patients]
AS
SELECT  B.empi ,
        A.[PATIENTID] ,
        A.[CARDNO] ,
        A.[MRN] ,
        eResearch.dbo.DesensitizeIdentityCard(A.[SSN]) AS [SSN] ,
            eResearch.dbo.DesensitizePatientName(A.[NAME]) AS [NAME] ,
            A.[SEX] ,
            A.[DOB] ,
            [MARITALSTATUS] ,
            [RACE] ,
            [NATIONALITY] ,
            A.[ADDRESS] ,
            [ZIPCODE] ,
            A.[PHONE] ,
            [CONTACTPERSONNAME] ,
            [CONTACTRELATIONSHIP] ,
            [CONTACTPHONE] ,
            A.[COMPANY] ,
            [COMPANYPHONE] ,
            DATEDIFF(YEAR, CAST(A.DOB AS DATE), GETDATE()) AS age ,
            A.NAME AS TRUENAME ,
            A.SSN AS TRUESSN,
			GETDATE() AS createtime
FROM   DW..ccr_patients A (NOLOCK)
    JOIN DW..PIX B (NOLOCK) ON A.PATIENTID = B.patientid
;

