--LBR

CREATE VIEW [dbo].[v_ccr_lab_obr]
AS
SELECT  b.empi ,
        REPORTNO [FILLERORDERNO], --Char(100)  
        '' [VISITNUMBER] , --Char(100)  
            visitNo [PATIENTID]  , --Char(100) ID ID
            REPORTNO [PLACERORDERNO]  , --Char(100)  
           ''  [SPECIMENID]  , --Char(50)  
           '' [SPECIMENSOURCECODE]  , --Char(100)  
          ''  [SPECIMENSOURCENAME]  , --Char(100)  
           '' [RESULTSTATUS]  , --Char(100)  
          ''  [DIAGSVCSECTID]  , --Char(50)  
          ''  [DIAGSVCSECTNAME]  , --Char(100)  
           '' [RELEVANTCLINICALINFO]  , --Char(500)  
           '' [ORDERINGFACILITY],
           '' [ORDERINGSERVICEUNITID]  , --Char(50) 
           '' [ORDERINGSERVICEUNITNAME]  , --Char(100) 
           '' [ORDERINGPROVIDERNO]   , --Char(50) 
           '' [ORDERINGPROVIDERNAME]  , --Char(100) 
           itemCode [UNIVERSALSERVICEID]  , --Char(50)  
           itemName [UNIVERSALSERVICENAME]  , --Char(100)  
           reportDate [OBSERVATIONDTTM] , --Date  
           testerId [PRINCIPALRESULTINTERPRETERNO]  , --Char(50) 
           testerName [PRINCIPALRESULTINTERPRETERNAME]  , --Char(50) 
           reportDate [FINALRESULTDTTM]  --Date 
FROM ODS..ORIGIN_LISSQ A (NOLOCK)
    JOIN DW..PIX B ON A.visitNo = B.patientid


--OBX

CREATE VIEW [dbo].[v_ccr_lab_obx]
AS
SELECT   A.empi ,
         B.reportNo [FILLERORDERNO], --Char(100)  
         B.reportNo [SETID], --Char(50)  
         '' [VISITNUMBER], --Char(100)  
            visitNo [PATIENTID], --Char(100) ID ID
           C.ORDERITEMCODE [OBSERVATIONID] , --Char(100) id RBC()WBC()
           ORDERITEMNAME  [OBSERVATION], --Char(50)  
           RESULT [OBSERVATIONVALUE], --Char(100)  
            [NUMERICOBSERVATIONVALUE] = CASE
			WHEN eResearch.dbo.TryPraseNumber(ISNULL(RESULT,''),-999)=-999 THEN 1
			ELSE eResearch.dbo.TryPraseNumber(ISNULL(RESULT,''),-999) END , --Decimal  
			[UNIT] , --Char(100)  
            [REFERENCERANGES] , --Char(100)  
            [ABNORMALFLAGS] = CASE UNCOMMONFLAG WHEN '' THEN '1' WHEN '' THEN '2' ELSE '' END , --Char(20)  
           ORDERITEMCODE [UNIVERSALSERVICEID], --Char(100)  
           ORDERITEMNAME [UNIVERSALSERVICENAME], --Char(100)  
           RESULTTIME [OBSERVATIONDTTM], --Date  
           '' [PRINCIPALRESULTINTERPRETERNO] , --Char(50) 
           '' [PRINCIPALRESULTINTERPRETERNAME], --Char(50) 
           '' [FINALRESULTDTTM] --Date 
    FROM    DW..PIX A WITH ( NOLOCK )
			JOIN ODS..LISSQ B ON A.patientid = B.visitNo
			JOIN ODS..ORIGIN_LISMX C ON B.reportNo = C.reportNo

--IMAGE

CREATE VIEW [dbo].[v_ccr_imagereport]
AS
SELECT   C.empi,
         A.reportNo [FILLERORDERNO] ,
         A.reportNo AS reportid ,
         A.reportNo AS reportseqid ,
    [VISITNUMBER] ,
    A.[PATIENTID] ,
    '' [ORDERINGFACILITY] ,
    A.reportNo [PLACERORDERNO] ,
    diagnosisNo [DIAGSVCSECTID] ,
    diagnosePrompt [DIAGSVCSECTNAME] ,
    '' [RELEVANTCLINICALINFO] ,
    reportTypeCode [ORDERINGSERVICEUNITID] ,
    A.reportType [ORDERINGSERVICEUNITNAME] ,
    '' [ORDERINGPROVIDERNO] ,
    '' [ORDERINGPROVIDERNAME] ,
    reportTypeCode [UNIVERSALSERVICEID] ,
    A.reportType [UNIVERSALSERVICENAME] ,
    reportDate [OBSERVATIONDTTM] ,
    reportDoctorCode [PRINCIPALRESULTINTERPRETERNO] ,
    reportDoctorName [PRINCIPALRESULTINTERPRETERNAME] ,
    '' [IMAGINGFINDINGS] ,
    reportView  [IMAGINGCONCLUSION] ,
    reportTime [FINALRESULTDTTM] ,
    A.reportContent [DIAGNOSTICIMAGINGTECH] ,
    ''  [BODYPART] ,
    '' AS studyinstanceuid ,
    '' AS aceesionnumber ,
    CASE WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%US%' THEN 'US'
    WHEN A.reportType LIKE '%CT%' THEN 'CT'
    WHEN A.reportType LIKE '%MR%' THEN 'MR'
    WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%DR%' THEN 'DR'
    WHEN A.reportType LIKE '%%' THEN 'MR'
    WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%B%' THEN ''
    WHEN A.reportType LIKE '%%' THEN ''
    WHEN A.reportType LIKE '%CR%' THEN 'CR'
    WHEN A.reportType LIKE '%DX%' THEN 'DX'
    WHEN A.reportType LIKE '%ES%' THEN 'ES'
    WHEN A.reportType LIKE '%RF%' THEN 'RF'
    ELSE ''
END AS Category
    FROM    ODS..PACSSQ A (NOLOCK)
	JOIN ODS..PACSMX B ON A.reportNo = B.reportNO
	JOIN DW..PIX C ON A.PATIENTID = C.patientid



CREATE VIEW [dbo].[v_ccr_emrdocuments]
AS
    WITH    t AS ( SELECT
    [DOCUMENTID] ,
    [VISITNUMBER] ,
    [PATIENTID] ,
    [CREATEDTTM] ,
    [CATEGORYCODE] ,
    [CATEGORYNAME] ,
    [AUTHENTICATEDTTM] ,
    [AUTHORNO] ,
    [AUTHORNAME] ,
    '' [AUTHENTICATORNO] ,
    '' [AUTHENTICATORNAME] ,
    [BODY_HTML] ,
    [BODY_TEXT] = isnull([BODY_TEXT],CAST(REPLACE(CONVERT(NVARCHAR(MAX), [BODY_XML]),
    'encoding="GBK"', '') AS XML).value('(.)[1]',
    'nvarchar(max)')) ,
    [BODY_XML] ,
    CASE WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%'
    THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    WHEN CATEGORYNAME LIKE '%%' THEN ''
    ELSE ''
    END AS Category
    FROM     dw..emrdocuments (NOLOCK)
)
SELECT  [empi] ,
    [DOCUMENTID] ,
    [VISITNUMBER] ,
    t.[PATIENTID] ,
    [CREATEDTTM] ,
    [CATEGORYCODE] ,
    [CATEGORYNAME] ,
    [AUTHENTICATEDTTM] ,
    [AUTHORNO] ,
    [AUTHORNAME] ,
    [AUTHENTICATORNO] ,
    [AUTHENTICATORNAME] ,
    [BODY_HTML] ,
    REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(CONVERT(NVARCHAR(MAX),[BODY_TEXT]),
    b.NAME, '**'),
    b.SSN, '***'),
    b.ADDRESS,
    '****'), b.PHONE,
    '**'),
    b.CONTACTPERSONNAME, '***'),
    b.CONTACTPHONE, '**'),
    t.AUTHORNAME, '**'), 'char(10)', ''),
    'char(13)', '') AS [BODY_TEXT] ,
    [BODY_XML] ,
    '' AS body_pdf ,
    '' AS body_image ,
    [Category],
    case when empi like '1222%' then 'Old' else 'New' end as VERSION
    FROM    t
            JOIN dw..ccr_patients b ( NOLOCK ) ON t.PATIENTID = b.PATIENTID
			JOIN DW..PIX C ON B.PATIENTID = C.PATIENTID
			;




